import '../styles/globals.css'
import Layout from '../components/Layout'
//import { DataProvider } from '../store/GlobalState'


function MyApp({ Component, pageProps }) {
  return (
   
      <Layout>
        <Component {...pageProps} />
      </Layout>
   
  )
}

export default MyApp
